import React, { Component } from "react";
import { Link } from "react-router-dom";

export class Navbar extends Component {
  render() {
    return (
      <div className="blueglitter">
      <div className="nav">

        <Link exact to="/" className="ui button">Home</Link>

          <Link exact to="/users/new" className="ui button">New User</Link>

          <Link exact to="/users" className="ui button">Users</Link>

          <Link exact to="/rounds/new" className="ui button">New Round</Link>

          <Link exact to="/rounds" className="ui button">Rounds</Link>

      </div>
      </div>
    );
  }
}

export default Navbar;
